INSERT INTO `rules` VALUES (1,'mandatory dc:identifier','dc:identifier field is mandatory.\r\nImpossible field identification without an identifier.','Field Exists',1,'a',3,'dc:identifier',1,'OAI Content Validation'),(2,'mandatory dc:title','dc:title field is mandatory.\r\nWithout a title it is very difficult to find and distinguish the digital object.','Field Exists',1,'a',4,'dc:title',1,'OAI Content Validation'),(3,'mandatory dc:date','dc:date field is mandatory.\r\nCannot correctly present the record.','Field Exists',1,'a',3,'dc:date',1,'OAI Content Validation'),(4,'mandatory dc:type','dc:type field is mandatory.\r\nFiltering for different types of objects is not possible without a type.','Field Exists',1,'a',3,'dc:type',1,'OAI Content Validation'),(5,'mandatory dc:creator','dc:creator field is mandatory.\r\nCannot correctly present the record otherwise.','Field Exists',1,'a',3,'dc:creator',1,'OAI Content Validation'),(6,'at least one dc:type follows publications vocabulary','At least one dc:type field must use one of the values defined in http://info-uri.info/registry/OAIHandler?verb=GetRecord&metadataPrefix=reg&identifier=info:eu-repo','Vocabulary',1,'>0',1,'dc:type',1,'OAI Content Validation'),(7,'dc:format field must use standard MIME types','dc:format field must use one of the values defined in http://www.iana.org/assignments/media-types.\r\nUse of non-standard content types leads to ambiguities in data interoperability  and representation.','Vocabulary',1,'a',3,'dc:format',1,'OAI Content Validation'),(8,'dc:date field appears only once','dc:date field appears only once, preferably containing the creation date.\r\nUse of more than one date fields increases ambiguity.','Cardinality',1,'a',2,'dc:date',1,'OAI Content Validation'),(9,'dc:date is ISO formatted','dc:date field  should use one of the formats defined in http://www.w3.org/TR/NOTE-datetime.\r\nUse of non-standard date formats leads to ambiguities in data interoperability  and representation.','Regular Expression',1,'a',3,'dc:date',1,'OAI Content Validation'),(10,'dc:identifier is a valid URL','dc:identifier field  should be used to indicate the URL of the object described in the metadata record.\r\nUse of a non valid  or stable URL address leads to failure in retrieving the object.','Valid Url',1,'>0',3,'dc:identifier',1,'OAI Content Validation'),(11,'dc:creator must use a standard format','Author (creator) names  must use a standard format.\r\nAccepted formats are:\r\n- surname, name\r\n- surname, X. name\r\n- surname, X.Y. name\r\n- surname, X.(name)\r\n- surname, X.Y.(name)\r\n- surname, X.Y.(name) prefix(2 or three letters)\r\n\r\nUse of non-standard author name formats leads to ambiguities in data interoperability  and representation.','Regular Expression',1,'a',1,'dc:creator',1,'OAI Content Validation'),(12,'dc:language follows ISO standards','dc:language field should use one of the following ISO standards: ISO 639-1, ISO 639-2, ISO 639-3.\r\nUse of non-standard language names leads to ambiguities in data interoperability and representation.','Vocabulary',1,'a',3,'dc:language',1,'OAI Content Validation'),(13,'dc:audience follows standard vocabulary','dc:audience field should use one of the values defined in http://www.ed.gov/admin/reference/index.jsp.\r\nUse of non-standard audience types leads to ambiguities in data interoperability and representation.','Vocabulary',1,'a',1,'dc:audience',1,'OAI Content Validation'),(14,'dc:source must NOT be valid URL','dc:identifier field contains the digitised resource location. The dc:source field should contain only metadata of a formal identifier system describing the original resource.\r\n\r\nService provides are expecting the web resource location to be found in the dc:identifier field. Putting it in the dc:source field might result in that fact that the user of a third party service is not able to link to your repository.','Valid Url',1,'=0',2,'dc:source',1,'OAI Content Validation'),(15,'dc:contributor must use a standard format','Author (contributor) names  must use a standard format.\r\nAccepted formats are:\r\n- surname, name\r\n- surname, X. name\r\n- surname, X.Y. name\r\n- surname, X.(name)\r\n- surname, X.Y.(name)\r\n- surname, X.Y.(name) prefix(2 or three letters)\r\n\r\nUse of non-standard author name formats leads to ambiguities in data interoperability  and representation.','Regular Expression',1,'a',1,'dc:contributor',1,'OAI Content Validation'),(16,'dc:source != dc:identifier','dc:source field content (reference to a resource from which the present resource is derived) must be different than the one used in dc:identifier (unambiguous reference to the resource within a given context).','Not Confused Fields',1,'a',1,'',1,'OAI Content Validation'),(17,'dc:relation != dc:identifier','dc:relation field content (reference to a related resource) must be different than the one used in dc:identifier (unambiguous reference to the resource within a given context).','Not Confused Fields',1,'a',1,'',1,'OAI Content Validation'),(18,'dc:relation != dc:source','dc:source field content (reference to a resource from which the present resource is derived) must be different than the one used in dc:relation (reference to a related resource).','Not Confused Fields',1,'a',1,'',1,'OAI Content Validation'),(19,'dc:identifier field contains resource','There must be a document resource in dc:identifier field and it must be downloadable.\r\n\r\nYou are allowed to insert a jump-off page in the dc:identifier field, however restriced access to the files your repository offers should be checked.','Retrievable Resource',1,'>0',1,'dc:identifier',1,'OAI Content Validation'),(20,'support of OAI_DC format','Use simple Dublin Core by default. Simple Dublin Core is the standard metadata format for repositories to disseminate and is mandatory in the OAI-PMH protocol.\r\n\r\nBy not offering simple Dublin Core as a metadata format, the repository is not syntactically interoperable and the data cannot be used in DRIVER.','Vocabulary',1,'>0',1,'verb=ListMetadataFormats, field=metadataPrefix',1,'OAI Usage Validation'),(21,'batch size within 100-500 records','Use a batch size between 100 and 500 records per resumption.\r\n\r\nBest practice has shown that, for performance reasons and balanced network load, records should be sent within a batch of a minimum of 100 and a maximum of 500 records. Repositories sending thousand of records all at once, may deliver broken XML files.','Cardinality',1,'a',1,'verb=ListRecords&metadataPrefix=oai_dc, field=record',1,'OAI Usage Validation'),(22,'\'Driver\' set must exist','Use a specific DRIVER set containing open access documents only. This rule applies to repositories which also include metadata only, or have toll-gated data.\r\n\r\nDRIVER aims at providing its end users transparent access to the full text documents, thus assuming that the whole repository contains full text / open accessible documents. If this is not the case, a \'DRIVER\' set containing such documents has to be visible.','Vocabulary',1,'>0',1,'verb=ListSets, field=setSpec',1,'OAI Usage Validation'),(23,'deletion strategy: transient or persistent','Use the transient or persistent deleting strategy.\r\n\r\nWhen the \'no\' deleting strategy is chosen, the repository does not keep track of the deleted records. In order for DRIVER to determine which records were deleted, it needs to re-harvest the whole repository, a very time consuming proccess. It is best therefore for the repository to provide the relevant information (note: modification dates should be changed accordingly).','Vocabulary',1,'a',1,'verb=Identify, field=deletedRecord',1,'OAI Usage Validation'),(24,'datestamp granularities must match','Use the same datestamp granularity in the OAI record with the one provided in the Identify verb.\r\n\r\nThe (DRIVER) harvesters rely on the correct datestamp information, and incremental harvesting is not possible when the date granularity cannot be processed.','Date Granularity',1,'a',1,'',1,'OAI Usage Validation'),(25,'incremental record delivery','Set up your repository with incremental harvesting capabilities.\r\n\r\nWhen the \'from\' and \'until\' commands are not working, DRIVER has to re-harvest your complete repository, consuming a lot of your repository bandwidth and DRIVER resources.','Incremental Record Delivery',1,'a',1,'',1,'OAI Usage Validation'),(26,'resumption token life span is 24h','The life span of a resumption token should be at least 24 hours.\r\n\r\nIf the life span is too short, e.g. 10 mins, and the harvester returns in 12 mins to get the next batch, the harvester will be too late and will only get the first batch.','Resumption Token Duration Check',1,'a',1,'',1,'OAI Usage Validation'),(27,'valid administrator e-mail','The administrator\'s e-mail address as exposed by the OAI-PMh Idetify response must be a valid e-mail address.\r\n\r\nIf the administrator\'s e-mail address is not a valid e-mail address the repository can not be registered in the DRIVER Information Space.','Regular Expression',1,'a',1,'verb=Identify, field=adminEmail',0,'OAI Usage Validation'),(28,'use of provenance element in records\' metadata','The provenance element in the about tag of the metadata can be used to relate to the original document deliverer.\r\n\r\nInformation about the original document deliverer cannot be acquired.','Schema Validity Check',1,'a',1,'verb=ListRecords&metadataPrefix=oai_dc',1,'OAI Usage Validation'),(29,'mandatory support of DIDL metadata format','MPEG21-DIDL is the recommended metastructure format for repository complex object dissemination.\r\n\r\nBy not offering MPEG21-DIDL as a structure format, it is very dificult to differentiate between object files that take part as downloadable resources of the publication, the jump-off page, or a formal actionable identifier.','Vocabulary',1,'>0',1,'verb=ListMetadataFormats, field=metadataPrefix',1,'OAI Usage Validation'),(30,'valid administrator e-mail','The administrator\'s e-mail address as exposed by the OAI-PMh Idetify response must be a valid e-mail address.\r\n\r\nIf the administrator\'s e-mail address is not a valid e-mail address the repository can not be registered in the DRIVER Information Space.','Regular Expression',1,'a',1,'verb=Identify, field=adminEmail',1,'OAI Usage Validation'),(31,'valid administrator e-mail','The administrator\'s e-mail address as exposed by the OAI-PMh Idetify response must be a valid e-mail address.\r\n\r\nIf the administrator\'s e-mail address is not a valid e-mail address the repository can not be registered in the DRIVER Information Space.','Regular Expression',1,'a',1,'verb=Identify, field=adminEmail',1,'OAI Usage Validation'),(32,'dc:creator may use a standard format','In openAIRE v1.0 guidelines, this rule is not mandatory\r\n\r\nAuthor (creator) names  must use a standard format.\r\nAccepted formats are:\r\n- surname, name\r\n- surname, X. name\r\n- surname, X.Y. name\r\n- surname, X.(name)\r\n- surname, X.Y.(name)\r\n- surname, X.Y.(name) prefix(2 or three letters)\r\n\r\nUse of non-standard author name formats leads to ambiguities in data interoperability  and representation.','Regular Expression',0,'a',1,'dc:creator',1,'OAI Content Validation'),(33,'dc:contributor may use a standard format','In openAIRE v1.0 guidelines, this rule is not mandatory.\r\n\r\nAuthor (contributor) names  must use a standard format.\r\nAccepted formats are:\r\n- surname, name\r\n- surname, X. name\r\n- surname, X.Y. name\r\n- surname, X.(name)\r\n- surname, X.Y.(name)\r\n- surname, X.Y.(name) prefix(2 or three letters)\r\n\r\nUse of non-standard author name formats leads to ambiguities in data interoperability  and representation.','Regular Expression',0,'a',1,'dc:contributor',1,'OAI Content Validation'),(34,'\'ec_fundedresources\' set must exist','The specific content of the \'ec_fundedresources\' set is to be determined at the local repository.\r\n\r\n\r\nThe content to be inserted in this set must conform to the following:\r\n1. All the resources that will be harvested are outcomes from research projects funded by the EC.\r\n2. All the resources that will be harvested are peer-reviewed.\r\n','Vocabulary',1,'>0',15,'verb=ListSets, field=setSpec',1,'OAI Usage Validation'),(35,'at least one dc:relation contains Grant Agreement information','A vocabulary of projects will be exposed by\r\nOpenAIRE through OAI-PMH, and available\r\nfor all repository managers. \r\n\r\nValues will include the project name and projectID.\r\n\r\nThe projectID equals the Grant Agreement number, and is defined by the namespace\r\ninfo:eu-repo/grantAgreement/EC/FP7\r\n\r\nThe namespace defines the grant agreement number from the funder (EC) and funder program (FP7).\r\n','Regular Expression',1,'>0',15,'dc:relation',1,'OAI Content Validation'),(36,'at least one dc:rights follows Access Rights vocabulary','Use values from vocabulary Access Rights at\r\nhttp://wiki.surffoundation.nl/display/standards/info-eu-repo/#info-eu-repo-AccessRights\r\n\r\nvalues are:\r\ninfo:eu-repo/semantics/closedAccess\r\ninfo:eu-repo/semantics/embargoedAccess\r\ninfo:eu-repo/semantics/restrictedAccess\r\ninfo:eu-repo/semantics/openAccess\r\n','Vocabulary',1,'>0',15,'dc:rights',1,'OAI Content Validation'),(37,'dc:date must contain the end of the embargo date (if applicable)','Recommended when accessRights = info:eu-repo/semantics/embargoedAccess\r\n\r\nThe date type is controlled by the namespace info:eu-repo/date/embargoEnd/, see\r\nhttp://wiki.surffoundation.nl/display/standa\r\nrds/info-eu-repo/#info-eu-repo-DateTypesandvalue\r\n\r\nEncoding of this date should be in the form YYYY-MM-DD(conform ISO 8601).','Regular Expression',0,'>0',0,'dc:date',1,'OAI Content Validation'),(38,'test test','test','Field Exists',1,'>0',1,'dc:test',0,'OAI Usage Validation'),(39,'test test','test2','Field Exists',0,'>0',1,'dc:test',0,'OAI Usage Validation');
